import React, { Component } from "react";
import { Link } from "react-router-dom";
import "../style/Course.css";
import "../App.css";

// import { Container, Form }from 'react-bootstrap'
// import 'bootstrap/dist/css/bootstrap.min.css'
//test
import contestList from "./test-data"; 


export default class Practiceques extends Component {

  constructor(props){
    super(props);
    this.state = {
      ques : this.props.Ques ,
      count : 0
    };
  }


  
  render() {
    
    const codebtn = {
      border: "2px solid white",
      width: "13%",
      display: "flex",
      justifyContent: "center",
      alignItems: "center"
    }


    return (
      <>
        <br />
        <div className="firsthead">
          <h1 style={{ color: "darkslategray", display: "inline-block" }}>
            Practice Questions{" "}
          </h1>
          <button value="Add Questions" id="rd_btn" >
            <Link to="/createques" style={{ color: "darkslategray" }}>
              {"Add Questions"}
            </Link>{" "} 
          </button> 
        </div> <br/>

        <div className="practiceques">

        <div className="Ques-box" style={{display:"flex"}}>
          <div className="Questions" id={this.state.count + 1} > {this.state.ques} </div>
          {
        contestList.map(contest => {
              return(
           
        <div className="Ques-box" style={{display:"flex"}}>
          <div className="Questions" id={this.state.count + 1} > 
            <div><p>{contest.ContestID}</p></div>
            <div><p>{contest.ContestTitle}</p></div>
            <div><p>{contest.ContestStatus}</p></div>
          </div>
          <Link to={`/contest/ViewContest/${contest.ContestID}`} style={openbtn} >Open</Link>
        </div>
        
           )
          })
          
        }
          </div>
        </div>
      </>
    );
  }
}
